var answer = ['_'];

var worded  = words.filter(function(item) {
 return item !== null && item !== undefined && item !== '';
});

function random_answer(){
	let num = worded.length;//정답 종류수
	answer = worded[Math.floor(Math.random() * num)];
}

function Wordle_tiles(){
	let f = 0;
	for (let i = 0; i < 6; i++){
		Wordle_tr = document.createElement('Wordle_tr');
		for (let j = 0; j < 5; j++){
			Wordle_td = document.createElement('Wordle_td');
			f = i * 5 + j;
            Wordle_td.id = "Wordle_" + f;
			Wordle_tr.appendChild(Wordle_td);
		}
		Wordle_table.appendChild(Wordle_tr, type="text");
	}
}

let l = 0;
function check_answer(){
	var input = document.querySelectorAll('.Wordle_input');
	var inputs = [''];
	var answer_px = Array.from(answer);
	var input_count = new Array(5);

	input_count = answer_px.reduce((ac, v) => ({ ...ac, [v]: (ac[v] || 0) + 1 }), {});
	for (let d = 0; d < 5; d++){	
		input[d].value = input[d].value.toLowerCase();
		inputs = inputs + input[d].value.toString();
	}
	function duplicate_check(k){
		return input_count[input[k].value] > 0 || input_count[input[k].value] == undefined;
	}

	for (let k = 0; k < 5; k++, l++){
		
		if (worded.includes(inputs) == true){
			if (input[k].value == answer[k] && duplicate_check(k)){
				document.getElementById("Wordle_" + l).style.backgroundColor = 'darkolivegreen';
				input_count[input[k].value]--;
			} else if (answer.includes(input[k].value) && duplicate_check(k)){
				document.getElementById("Wordle_" + l).style.backgroundColor = 'darkkhaki';
				input_count[input[k].value]--;
			} else {
				document.getElementById("Wordle_" + l).style.backgroundColor = 'darkviolet';
			}
			document.getElementById("Wordle_" + l).innerHTML = input[k].value;
			input[k].value = null;
		}
	}
	if (inputs == answer){
		alert("정답!!");
		Wordle_reset_button();
	}
	if (worded.includes(inputs) == false && inputs != undefined){
		alert("없거나 입력되지 않은단어 입니다!!");
		l = l - 5;
		for (let k = 0; k < 5; k++){
			input[k].value = null;
		}
	 }else if (l == 30){
		alert("정답은" + answer + "입니다!!");
		Wordle_reset_button();
	}
}

function not_reach_answer(){
	if (l < 30){
		console.log(answer);
		alert("정답은" + answer + "였습니다!!");
	}
}

function Wordle_reset_button(){
	var input = document.querySelectorAll('.Wordle_input');
	for (let k = 0; k < 5; k++){
		input[k].value = null;
	}
	for (let q = 0; q < 30; q++){
		document.getElementById("Wordle_" + q).style.backgroundColor = null;
		document.getElementById("Wordle_" + q).innerHTML = null;
	}
	l = 0;
	random_answer();
}

function MoveCursor(obj,nextObjID,backObjID,keyCode){
	if(keyCode == 8 || keyCode == 37){
		document.getElementById(backObjID).focus();
		document.getElementById(backObjID).setSelectionRange(0, 1);
    	return;
	}else if(obj.value.length == 1 && keyCode == 13){
		check_answer();
		document.getElementById("input0").focus();
	}else if(obj.value.length == 1 || keyCode == 39){
    	document.getElementById(nextObjID).focus();
		document.getElementById(nextObjID).setSelectionRange(0, 1);
    	return;
	}
}

function handleOnInput(e)  {
  e.value = e.value.replace(/[^A-Za-z]/ig, '')
}

function Wordle_game(){
	
	random_answer();
	
	Wordle_tiles();
	
	document.getElementById("Wordle_button").addEventListener('click', check_answer);
}

Wordle_game();